import styled from 'styled-components';

const style = () => styled.div`
    .form-container {
        display: grid;
        grid-template-columns: 1fr 1fr;

        .right {

            .form {

                .form-header {
                    color: #706f70;
                }

                input {
                    border: none;

                }
            }
        }
    }

`

export default style
